import _ from 'lodash'
import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { connect } from 'react-redux'
import { fetchposts, getCustomersByUrl } from '../actions/notes'

class PostList extends Component {
  componentDidMount () {
    this.props.fetchposts()
    this.nextPage.bind(this)
  }

  nextPage () {
    this.props.getCustomersByUrl(this.props.posts.next)
  }
  renderPosts () {
    console.log(this.props.posts.count)
    return _.map(this.props.posts.results, post => {
      return (
        <li key={post.pk}>
          {post.name}
        </li>
      )
    })
  }

  render () {
    console.log(this.props.posts)
    return (
      <div>
        <h3>Posts</h3>
        <ul>
          {this.renderPosts()}
        </ul>
        <button onClick={this.nextPage}>Previous</button>
        <button onClick={this.nextPage}>Next</button>

      </div>
    )
  }
}

function mapStateToProps (state) {
  return { posts: state.posts }
}

export default connect(mapStateToProps, { fetchposts, getCustomersByUrl })(PostList)
